// src/components/TopBar.js
import React, { useEffect, useState } from 'react';
import { AppBar, Toolbar, Typography, Box, Chip, Stack } from '@mui/material';
import AccessTimeIcon from '@mui/icons-material/AccessTime';
import SignalCellularAltIcon from '@mui/icons-material/SignalCellularAlt';
import BatteryChargingFullIcon from '@mui/icons-material/BatteryChargingFull';
import GpsFixedIcon from '@mui/icons-material/GpsFixed';

const TopBar = ({ telemetry }) => {
  const [time, setTime] = useState(new Date());

  useEffect(() => {
    const interval = setInterval(() => setTime(new Date()), 1000);
    return () => clearInterval(interval);
  }, []);

  const battery = telemetry?.battery?.toFixed(2) ?? 'N/A';
  const connection = telemetry?.connection ?? 'N/A';
  const gps = telemetry?.gps
    ? `Lat: ${telemetry.gps.lat.toFixed(2)}, Lon: ${telemetry.gps.lon.toFixed(2)}`
    : 'N/A';

  return (
    <AppBar position="static" color="transparent" elevation={0}>
      <Toolbar
        sx={{
          display: 'flex',
          justifyContent: 'space-between',
          borderBottom: '1px solid #334155',
          background: '#1e293b',
        }}
      >
        {/* Left Side: Icons */}
        <Stack direction="row" spacing={2} alignItems="center">
          <Chip icon={<BatteryChargingFullIcon />} label={`${battery} V`} color="primary" />
          <Chip icon={<GpsFixedIcon />} label={gps} color="primary" />
          <Chip icon={<SignalCellularAltIcon />} label={connection} color="primary" />
        </Stack>

        {/* Right Side: Title + Time */}
        <Stack direction="row" spacing={2} alignItems="center">
          <Typography variant="h6" sx={{ fontWeight: 'bold', color: '#00ffff' }}>
            DRONE DASHBOARD
          </Typography>
          <Chip
            icon={<AccessTimeIcon />}
            label={time.toLocaleTimeString()}
            color="secondary"
            sx={{ ml: 2 }}
          />
        </Stack>
      </Toolbar>
    </AppBar>
  );
};

export default TopBar;
